import React from "react";

const url = "https://image.tmdb.org/t/p/w500/A0knvX7rlwTyZSKj8H5NiARb45.jpg";

export const Card_Movie = () => {
  return (
    <div className="container w-48 overflow-hidden mx-5 shadow-2xl cursor-pointer">
      <div>
        <img src={url} alt="asd" className="rounded-lg cursor-pointer" />
      </div>

      <div className="p-2">
        <h1 className="text-center">Title</h1>
        <h2 className="text-center">15/5/2012</h2>
        <p className="text-center">72%</p>
      </div>
    </div>
  );
};

export default Card_Movie;
